import { useState } from "react";
import { useNavigate } from "react-router-dom";
import NavbarComponent from "../components/Navbar";

const LandingPage = () => {
    // navigate
    const navigate = useNavigate()

    // handle submit
    const handleSubmit = (amdin) => {
        localStorage.setItem("admin", amdin)
        navigate("/login")
    }

    // return
    return (
        <>
            <NavbarComponent now={''} />
            <div 
                className="flex w-full h-screen justify-center items-center bg-gray-900 px-4"
                style={{
                    backgroundImage: `url('https://t3.ftcdn.net/jpg/07/52/70/26/360_F_752702693_UcYNYcWgDY5fEwG3xN7j5iwFIPQGC3jx.jpg')`,
                    backgroundSize: 'cover',
                    backgroundPosition: 'center',
                    backgroundRepeat: 'no-repeat',
                    opacity: 0.9, // Adjust for transparency
                }}
            >
                <div onClick={() => handleSubmit("college")} className="flex w-72 h-40 mr-3 justify-center items-center border-2 border-yellow-500 hover:bg-yellow-500 text-white hover:text-black rounded-lg px-10 py-10 font-bold text-lg uppercase">
                    <h1>College</h1>
                </div>
                <div onClick={() => handleSubmit("canteen")} className="flex w-72 h-40 ml-3 justify-center items-center border-2 border-yellow-500 hover:bg-yellow-500 text-white hover:text-black rounded-lg px-10 py-10 font-bold text-lg uppercase">
                    <h1>Canteen</h1>
                </div>
            </div>
        </>
    );
}

export default LandingPage;
